export default Object.prototype.eventFallMove = function () {
    if (this.context) {
        var $this = this
        var ctx = $this.context

        $this.running = false

        var raf;

        $this.start = function() {
            $this.running = true
            $this.draw()
                .toX($this.x)
                .toY($this.y)

            $this.x += $this.vx
            $this.y += $this.vy
            $this.vy *= .99
            $this.vy += .25

            if ($this.y + $this.vy > $this.element.height
                || $this.y + $this.vy < 0) {
                $this.vy = -$this.vy
            }

            if ($this.x + $this.vx > $this.element.width
                || $this.x + $this.vx < 0) {
                $this.vx = -$this.vx
            }
            raf = window.requestAnimationFrame($this.start)
        }

        $this.stop = function() {
            $this.running = false
            window.cancelAnimationFrame(raf)
        }

        return $this
    }
}

export default Object.prototype.eventMouseFollow = function () {
    if (this.context) {
        var $this = this
        var ctx = $this.context

        function clear() {
            ctx.fillStyle = 'rgba(255,255,255,0.1)'
            ctx.fillRect(0, 0, $this.element.width, $this.element.height)
        }

        $this.element.addEventListener('mousemove', function (e) {
            if (!$this.running) {
                clear()
                $this.x = e.clientX
                $this.y = e.clientY
                $this.draw()
            }
        })

        $this.element.addEventListener('click', function (e) {
            if (!$this.running) {
                $this.start()
            } else {
                $this.stop()
            }
        })


        return $this
    }
}

/**
 * Evento de objeto se movendo na tela.
 * Têm-se o x, y, vx, vy.
 * Objeto se move de acordo com x e y.
 * Utiliza-se vx e vy para somar as váriaveis de posição.
 * Quando se objeto chega ao limite do canvas, nega-se o vx e vy para
 * inverter a soma, fazendo com que o x e y decremente, e ao retornar
 * inverte-se novamente para o x e y incrementar, movendo assim o objeto
 * em sentidos opostos. 
 */
export default Object.prototype.eventRandomOne = function () {
    if (this.context) {
        var $this = this
        var ctx = $this.context

        var raf;

        function draw() {
            $this.draw()
                .toX($this.x)
                .toY($this.y)

            $this.x += $this.vx
            $this.y += $this.vy

            if ($this.y + $this.vy > $this.element.height
                || $this.y + $this.vy < 0) {
                $this.vy = -$this.vy
            }

            if ($this.x + $this.vx > $this.element.width
                || $this.x + $this.vx < 0) {
                $this.vx = -$this.vx
            }
            raf = window.requestAnimationFrame(draw)
        }

        draw()
        return $this
    }
}

