export default Object.prototype.createBall = function (x,y) {
    if (this.context) {
        var $this = this
        $this.x = x
        $this.y = y
        $this.vx = 5
        $this.vy = 2
        $this.radius = 25
        $this.color = 'blue'
        $this.draw = function () {
            $this.clearRect(0, 0, $this.element.width, $this.element.height);
            $this.context.beginPath();
